import React from "react";
import Header from "../components/header";
import Banner from "../components/banner";
import styles from "./main.module.css";

function Main() {
  return (
    <>
      <Header />
      <Banner />배너
      <div className={styles.mainSection}>
        와우 메인영역이야!
      </div>
    </>
  );
}
export default Main;
